abort is an expression that takes one argument: an abort code of type u64. For example: abort 表达式只接受一个参数: 类型为 u64 的 中止代码 。例如： abort 42 The abort expression halts execution the current function and reverts all changes made to global state by the current transaction. There is no mechanism for "catching" or otherwise handling an abort. abort 表达式会中止执行当前函数并恢复当前事务对全局状态所做的所有更改。Move语言没有“捉捕”或者额外处理abort的机制。 Luckily, in Move transactions are all or nothing, meaning any changes to global storage are made all at once only if the transaction succeeds. Because of this transactional commitment of changes, after an abort there is no need to worry about backing out changes. While this approach is lacking in flexibility, it is incredibly simple and predictable. 幸运的是，在Move里事务的计算要么完全执行要么完全不执行。这意味着只有在事务成功时，任何对全局存储状态的改变才会被一并执行。 由于这种对于所有更改的事务承诺，在 abort 之后我们不需要担心去回滚任何更改。尽管这种方法缺少灵活性，它还是非常简单和可预测的。 Similar to return , abort is useful for exiting control flow when some condition cannot be met. In this example, the function will pop two items off of the vector, but will abort early if the vector does not have two items 与 return 相似, 在一些条件无法被满足的时候，abort 可以被用于退出控制流(control flow)。 在以下示例中，目标函数会从vector里弹出两个元素，但是如果vector中并没有两个元素，函数会提前中止。 use std::vector;
fun pop_twice<T>(v: &mut vector<T>): (T, T) { if (vector::length(v) < 2) abort 42; (vector::pop_back(v), vector::pop_back(v))
} This is even more useful deep inside a control-flow construct. For example, this function checks that all numbers in the vector are less than the specified bound. And aborts otherwise 这在控制流结构的深处甚至会更有用。例如，此函数检查vector中是否所有数字都小于指定的边界(bound)。否则函数中止： use std::vector;
fun check_vec(v: &vector<u64>, bound: u64) { let i = 0; let n = vector::length(v); while (i < n) { let cur = *vector::borrow(v, i); if (cur > bound) abort 42; i = i + 1; }
}

