When using abort, it is important to understand how the u64 code will be used by the VM. Normally, after successful execution, the Move VM produces a change-set for the changes made to global storage (added/removed resources, updates to existing resources, etc). 当使用 abort 时，理解虚拟机将如何使用 u64 代码是非常重要的。 通常，在成功执行后，Move 虚拟机会为对全局存储(添加/删除资源、更新现有资源等)所做的更改生成一个更改集。 If an abort is reached, the VM will instead indicate an error. Included in that error will be two pieces of information: The module that produced the abort (address and name) The abort code. For example 如果执行到 abort 代码，虚拟机将指示错误。该错误中包含两块信息： 发生中止的模块(地址和名称) 错误状态码。 例如 address 0x2 { module example { public fun aborts() { abort 42 } }
} script { fun always_aborts() { 0x2::example::aborts() }
} If a transaction, such as the script always_aborts above, calls 0x2::example::aborts, the VM would produce an error that indicated the module 0x2::example and the code 42. This can be useful for having multiple aborts being grouped together inside a module. In this example, the module has two separate error codes used in multiple functions 如果一个事务，例如上面的脚本 always_aborts 调用了 0x2::example::aborts，虚拟机将产生一个指示模块 0x2::example 和错误状态码 42 的错误。 这在一个模块内将多个中止功能组合起来会很有用。 在以下示例中，模块有两个单独的错误状态码，用于多个函数 address 0x42 { module example { use std::vector; const EMPTY_VECTOR: u64 = 0; const INDEX_OUT_OF_BOUNDS: u64 = 1; // 移动 i 到 j, 移动 j 到 k, 移动 k 到 i public fun rotate_three<T>(v: &mut vector<T>, i: u64, j: u64, k: u64) { let n = vector::length(v); assert!(n > 0, EMPTY_VECTOR); assert!(i < n, INDEX_OUT_OF_BOUNDS); assert!(j < n, INDEX_OUT_OF_BOUNDS); assert!(k < n, INDEX_OUT_OF_BOUNDS); vector::swap(v, i, k); vector::swap(v, j, k); } public fun remove_twice<T>(v: &mut vector<T>, i: u64, j: u64): (T, T) { let n = vector::length(v); assert!(n > 0, EMPTY_VECTOR); assert!(i < n, INDEX_OUT_OF_BOUNDS); assert!(j < n, INDEX_OUT_OF_BOUNDS); assert!(i > j, INDEX_OUT_OF_BOUNDS); (vector::remove<T>(v, i), vector::remove<T>(v, j)) } }
}

