Module functions, by default, can only be called within the same module. These internal (sometimes called private) functions cannot be called from other modules or from scripts. 默认情况下，模块函数只能在同一个模块内调用。这些内部(有时称为私有)函数不能从其他模块或脚本中调用。 address 0x42 { module m { fun foo(): u64 { 0 } fun calls_foo(): u64 { foo() } // valid } module other { fun calls_m_foo(): u64 { 0x42::m::foo() // ERROR! // ^^^^^^^^^^^^ 'foo' is internal to '0x42::m' } }
} script { fun calls_m_foo(): u64 { 0x42::m::foo() // ERROR!
// ^^^^^^^^^^^^ 'foo' is internal to '0x42::m' }
} To allow access from other modules or from scripts, the function must be declared public or public(friend). 要允许从其他模块或脚本访问，该函数必须声明为 public 或 public(friend)。 public 可见性 (public visibility) A public function can be called by any function defined in any module or script. As shown in the following example, a public function can be called by: other functions defined in the same module, functions defined in another module, or the function defined in a script. public 函数可以被任何模块或脚本中定义的任何函数调用。如以下示例所示，可以通过以下方式调用 public 函数： 在同一模块中定义的其他函数 在另一个模块中定义的函数 在脚本中定义的函数 address 0x42 { module m { public fun foo(): u64 { 0 } fun calls_foo(): u64 { foo() } // valid } module other { fun calls_m_foo(): u64 { 0x42::m::foo() // valid } }
} script { fun calls_m_foo(): u64 { 0x42::m::foo() // valid }
} public(friend) 可见性 (public(friend) visibility) The public(friend) visibility modifier is a more restricted form of the public modifier to give more control about where a function can be used. A public(friend) function can be called by: other functions defined in the same module, or functions defined in modules which are explicitly specified in the friend list (see Friends on how to specify the friend list). Note that since we cannot declare a script to be a friend of a module, the functions defined in scripts can never call a public(friend) function. public(friend) 可见性修饰符是一种比 public 修饰符限制更严格的形式，可以更好地控制函数的使用位置。 public(friend) 函数可以通过以下方式调用： 在同一模块中定义的其他函数，或者在 friend list 中明确指定的模块中定义的函数(请参阅 Friends 了解如何指定友元(friends)列表)。 请注意，由于我们不能将脚本声明为模块的友元关系，因此脚本中定义的函数永远不能调用 public(friend) 函数。 address 0x42 { module m { friend 0x42::n; // friend declaration public(friend) fun foo(): u64 { 0 } fun calls_foo(): u64 { foo() } // valid } module n { fun calls_m_foo(): u64 { 0x42::m::foo() // valid } } module other { fun calls_m_foo(): u64 { 0x42::m::foo() // ERROR! // ^^^^^^^^^^^^ 'foo' can only be called from a 'friend' of module '0x42::m' } }
} script { fun calls_m_foo(): u64 { 0x42::m::foo() // ERROR!
// ^^^^^^^^^^^^ 'foo' can only be called from a 'friend' of module '0x42::m' }
}

