The entry modifier is designed to allow module functions to be safely and directly invoked much like scripts. This allows module writers to specify which functions can be to begin execution. The module writer then knows that any non-entry function will be called from a Move program already in execution. Essentially, entry functions are the "main" functions of a module, and they specify where Move programs start executing. Note though, an entry function can still be called by other Move functions. So while they can serve as the start of a Move program, they aren't restricted to that case. entry 修饰符旨在允许像脚本一样安全直接地调用模块函数。这允许模块编写者指定哪些函数可以成为开始执行的入口。这样模块编写者就知道任何非entry函数都是从已经在执行的 Move 程序中被调用的。 本质上，entry 函数是模块的“main”函数，它们指定 Move 程序开始执行的位置。 但请注意，entry 函数仍可被其他 Move 函数调用。因此，虽然它们 可以 作为 Move 程序的入口，但它们并不局限于这种用法。 例如： address 0x42 { module m { public entry fun foo(): u64 { 0 } fun calls_foo(): u64 { foo() } // valid! } module n { fun calls_m_foo(): u64 { 0x42::m::foo() // valid! } } module other { public entry fun calls_m_foo(): u64 { 0x42::m::foo() // valid! } }
} script { fun calls_m_foo(): u64 { 0x42::m::foo() // valid! }
} Even internal functions can be marked as entry! This lets you guarantee that the function is called only at the beginning of execution (assuming you do not call it elsewhere in your module) 甚至内部函数也可以标记为 entry！这使你可以保证仅在开始执行时调用该函数(假如你没有在模块中的其他地方调用它) address 0x42 { module m { entry fun foo(): u64 { 0 } // valid! entry functions do not have to be public } module n { fun calls_m_foo(): u64 { 0x42::m::foo() // ERROR! // ^^^^^^^^^^^^ 'foo' is internal to '0x42::m' } } module other { public entry fun calls_m_foo(): u64 { 0x42::m::foo() // ERROR! // ^^^^^^^^^^^^ 'foo' is internal to '0x42::m' } }
} script { fun calls_m_foo(): u64 { 0x42::m::foo() // ERROR!
// ^^^^^^^^^^^^ 'foo' is internal to '0x42::m' }
}

