Change directory into the step_1/BasicCoin directory. You should see a directory called sources -- this is the place where all the Move code for this package lives. You should also see a Move.toml file as well. This file specifies dependencies and other information about the package; if you're familiar with Rust and Cargo, the Move.toml file is similar to the Cargo.toml file, and the sources directory similar to the src directory. 切换当前目录到 step_1/BasicCoin 下，您将看到 sources 子目录 -- 这个包(package)下所有的 Move 代码都在此目录中，同时您还会看到一个 Move.toml 文件。该文件指定当前包的依赖列表和其他信息。 如果您熟悉 Rust 和 Cargo，那 Move.toml 文件类似 Cargo.toml 文件， sources 目录类似 src 目录(它们的作用是一样的) Let's take a look at some Move code! Open up sources/FirstModule.move in your editor of choice. The first thing you'll see is this: 来一起看看 Move 语言代码内容！ 用你的编辑器打开 sources/FirstModule.move 文件，会看到如下内容： // sources/FirstModule.move
module 0xCAFE::BasicCoin { ...
} This is defining a Move module . Modules are the building block of Move code, and are defined with a specific address -- the address that the module can be published under. In this case, the BasicCoin module can only be published under 0xCAFE. 这是一个 Move module(模块) 的定义。 模块是 Move 语言的代码块, 并且它使用指定的地址(address)进行定义 -- 模块只能在该地址下发布。 当前 BasicCoin 模块只能被发布在 0xCAFE 地址下。 Let's now take a look at the next part of this file where we define a struct to represent a Coin with a given value: 再看这个文件的下一部分，这里定义了一个具有字段 value 的 结构体 Coin： module 0xCAFE::BasicCoin { struct Coin has key { value: u64, } ...
} Looking at the rest of the file, we see a function definition that creates a Coin struct and stores it under an account: 再看文件剩余部分，我们会看到一个函数，它会创建一个 Coin 结构体，并将其保存在某个账号(account)下： module 0xCAFE::BasicCoin { struct Coin has key { value: u64, } public fun mint(account: signer, value: u64) { move_to(&account, Coin { value }) }
