l in the struct definition, or it is only used as an argument to type parameters also declared as phantom. Phantom 类型参数解决了这个问题。未使用的类型参数可以标记为 phantom 类型参数，不参与结构体的能力推导。这样，在派生泛型类型的能力时，不考虑 phantom type 的参数，从而避免了对虚假能力标注的需要。为了使这个宽松的规则合理，Move 的类型系统保证声明为 phantom 的参数要么不在结构定义中使用，要么仅用作声明为 phantom 的类型参数的参数。 声明 (Declaration) In a struct definition a type parameter can be declared as phantom by adding the phantom keyword before its declaration. If a type parameter is declared as phantom we say it is a phantom type parameter. When defining a struct, Move's type checker ensures that every phantom type parameter is either not used inside the struct definition or it is only used as an argument to a phantom type parameter. phantom 在结构定义中，可以通过在声明之前添加关键字来将类型参数声明为幻影。如果一个类型参数被声明为 phantom，我们就说它是 phantom 类型参数。 定义结构体时，Move语言的类型检查器确保每个 phantom 类型参数要么不在结构定义中使用，要么仅用作 phantom 类型参数的参数。 More formally, if a type is used as an argument to a phantom type parameter we say the type appears in phantom position . With this definition in place, the rule for the correct use of phantom parameters can be specified as follows: A phantom type parameter can only appear in phantom position . 更正式地说，如果将类型用作 phantom 类型参数的输入参数，我们说该类型出现在 phantom 位置 。有了这个定义，正确使用 phantom 参数的规则可以指定如下： ** phantom 类型参数只能出现在 phantom 位置**。 The following two examples show valid uses of phantom parameters. In the first one, the parameter T1 is not used at all inside the struct definition. In the second one, the parameter T1 is only used as an argument to a phantom type parameter. 以下两个示例显示了 phantom 参数的 合法用法。在第一个中，T1 在结构体定义中根本不使用参数。在第二种情况下，参数 T1 仅用作 phantom 类型参数的参数。 struct S1<phantom T1, T2> { f: u64 } ^^ Ok: T1 does not appear inside the struct definition struct S2<phantom T1, T2> { f: S1<T1, T2> } ^^ Ok: T1 appears in phantom position The following code shows examples of violations of the rule: 以下代码展示违反规则的示例： struct S1<phantom T> { f: T } ^ Error: Not a phantom position struct S2<T> { f: T } struct S3<phantom T> { f: S2<T> } ^ Error: Not a phantom position 实例化 (Instantiation) When instantiating a struct, the arguments to phantom parameters are excluded when deriving the struct abilities. For example, consider the following code: 实例化结构时，派生结构功能时会排除幻影参数的输入参数。例如，考虑以下代码： struct S<T1, phantom T2> has copy { f: T1 }
