Now let's take a closer look at the implementation of the methods inside BasicCoin.move . 现在仔细看看 BasicCoin.move 中内部方法的实现。 publish_balance方法 (Method publish_balance) This method publishes a Balance resource to a given address. Since this resource is needed to receive coins through minting or transferring, publish_balance method must be called by a user before they can receive money, including the module owner. 此方法将 Balance 资源发布到指定地址名下。由于此资源需要通过铸造或转账来接收代币，必须由用户先调用方法 publish_balance 才能接收钱，包括模块所有者。 This method uses a move_to operation to publish the resource: 此方法使用 move_to 操作来发布资源： let empty_coin = Coin { value: 0 };
move_to(account, Balance { coin: empty_coin }); mint方法 (Method mint)） Here we require that mint must be approved by the module owner. We enforce this using the assert statement: mint method mints coins to a given account. mint 方法将代币铸造到指定的帐户。在此我们要求 mint 必须得到模块所有者的批准。我们使用 assert 语句强制执行此操作： assert!(signer::address_of(&module_owner) == MODULE_OWNER, errors::requires_address(ENOT_MODULE_OWNER)); Assert statements in Move can be used in this way: assert!(<predicate>, <abort_code>);. This means that if the <predicate> is false, then abort the transaction with <abort_code>. Here MODULE_OWNER and ENOT_MODULE_OWNER are both constants defined at the beginning of the module. And errors module defines common error categories we can use. It is important to note that Move is transactional in its execution -- so if an abort is raised no unwinding of state needs to be performed, as no changes from that transaction will be persisted to the blockchain. Move 中的 assert 语句可以这样使用：assert!(<predicate>, <abort_code>);。这意味着如果 <predicate> 为假，则使用中止错误码 <abort_code> 来终止交易。此处的 MODULE_OWNER 和 ENOT_MODULE_OWNER 都是在模块开头定义的常量。errors 模块定义了我们可以使用的常见错误种类。重点是我们需要注意 Move 在其执行过程中是事务性的-- 因此，如果触发 中止(abort) ，并不用回退已执行状态的，因为该事务的任何更改都不会持久保存到区块链。 We then deposit a coin with value amount to the balance of mint_addr. 然后将数量为 amount 的代币存入 mint_addr 的余额中。 deposit(mint_addr, Coin { value: amount }); balance_of方法 (Method balance_of) We use borrow_global, one of the global storage operators, to read from the global storage. 我们使用全局存储操作之一的 borrow_global 从全局存储中读取资源(数据)。 borrow_global<Balance>(owner).coin.value | | \ / resource type address field names transfer方法 (Method transfer) This function withdraws tokens from from's balance and deposits the tokens into tos balance. We take a closer look at withdraw helper function: 该函数从 from 的余额中提取代币并将代币存入 to 的余额中。我们仔细研究帮助函数 withdraw： fun withdraw(addr: address, amount: u64) : Coin acquires Balance { let balance = balance_of(addr); assert!(balance >= amount, EINSUFFICIENT_BALANCE); let balance_ref = &mut borrow_global_mut<Balance>(addr).coin.value; *balance_ref = balance - amount; Coin { value: amount }
} At the beginning of the method, we assert that the withdrawing account has enough balance. We then use borrow_global_mut to get a mutable reference to the global storage, and &mut is used to create a mutable reference to a field of a struct. We then modify the balance through this mutable reference and return a new coin with the withdrawn amount. 在方法开始，我们断言提款账户有足够的余额。然后我们使用 borrow_global_mut 来获得全局存储的可变引用，并用 &mut 创建结构体字段的 可变引用 。然后我们通过这个可变引用修改余额并返回一个带有提取金额的新代币。

