To declare that a struct has an ability, it is declared with has <ability> after the struct name but before the fields. For example: 要声明一个 struct 具有某个能力，它在结构体名称之后, 在字段之前用 has <ability> 声明。例如： struct Ignorable has drop { f: u64 }
struct Pair has copy, drop, store { x: u64, y: u64 } In this case: Ignorable has the drop ability. Pair has copy, drop, and store. 在这个例子中：Ignorable 具有 drop 能力。 Pair 具有 copy、drop 和 store 能力。 All of these abilities have strong guarantees over these gated operations. The operation can be performed on the value only if it has that ability; even if the value is deeply nested inside of some other collection! 所有这些能力对这些访问操作都有强有力的保证。只有具有该能力，才能对值执行对应的操作；即使该值深层嵌套在其他集合中！ As such: when declaring a struct’s abilities, certain requirements are placed on the fields. All fields must satisfy these constraints. These rules are necessary so that structs satisfy the reachability rules for the abilities given above. If a struct is declared with the ability... copy, all fields must have copy. drop, all fields must have drop. store, all fields must have store. key, all fields must have store. key is the only ability currently that doesn’t require itself. 因此：在声明结构体的能力时，对字段提出了某些要求。所有字段都必须满足这些约束。这些规则是必要的，以便结构体满足上述功能的可达性规则。如果一个结构被声明为具有某能力： copy， 所有的字段必须具有 copy 能力。 drop，所有的字段必须具有 drop 能力。 store，所有的字段必须具有 store 能力。 key，所有的字段必须具有 store 能力。key 是目前唯一不需要包含自身的能力。 例如: // A struct without any abilities
struct NoAbilities {} struct WantsCopy has copy { f: NoAbilities, // ERROR 'NoAbilities' does not have 'copy'
} and similarly: 类似的： // A struct without any abilities
struct NoAbilities {} struct MyResource has key { f: NoAbilities, // Error 'NoAbilities' does not have 'store'
}

