There are several different syntax cases for use. Starting with the most simple, we have the following for creating aliases to other modules 这里有几种不同的语法案例可供使用。从最简单的开始，我们有以下例子用于为其他模块创建别名 use <address>::<module name>;
use <address>::<module name> as <module alias name>; For example 举例 use std::vector;
use std::vector as V; use std::vector; introduces an alias vector for std::vector. This means that anywhere you would want to use the module name std::vector (assuming this use is in scope), you could use vector instead. use std::vector; is equivalent to use std::vector as vector; use std::vector；为 std::vector 引入别名向量。这意味着在任何您想使用模块名称 std::vector 的地方（假设此use在作用域内），您都可以使用 vector 代替使用std::vector; Similarly use std::vector as V; would let you use V instead of std::vector 同样使用 std::vector as V;会让你使用 V 代替 std::vector use std::vector;
use std::vector as V; fun new_vecs(): (vector<u8>, vector<u8>, vector<u8>) { let v1 = std::vector::empty(); let v2 = vector::empty(); let v3 = V::empty(); (v1, v2, v3)
} If you want to import a specific module member (such as a function, struct, or constant). You can use the following syntax. 如果要导入特定的模块成员（例如函数、结构或常量）。您可以使用以下语法。 use <address>::<module name>::<module member>;
use <address>::<module name>::<module member> as <member alias>; For example 举例 use std::vector::empty;
use std::vector::empty as empty_vec; This would let you use the function std::vector::empty without full qualification. Instead you could use empty and empty_vec respectively. Again, use std::vector::empty; is equivalent to use std::vector::empty as empty; 这将允许您在没有前缀限定的情况下使用函数 std::vector::empty。相反，您可以分别使用 empty 和 empty_vec，使用 std::vector::empty;使用empty 相当于使用std::vector::empty; use std::vector::empty;
use std::vector::empty as empty_vec; fun new_vecs(): (vector<u8>, vector<u8>, vector<u8>) { let v1 = std::vector::empty(); let v2 = empty(); let v3 = empty_vec(); (v1, v2, v3)
} If you want to add aliases for multiple module members at once, you can do so with the following syntax 如果要一次为多个模块成员添加别名，可以使用以下语法 use <address>::<module name>::{<module member>, <module member> as <member alias> ... }; For example 举例 use std::vector::{push_back, length as len, pop_back}; fun swap_last_two<T>(v: &mut vector<T>) { assert!(len(v) >= 2, 42); let last = pop_back(v); let second_to_last = pop_back(v); push_back(v, last); push_back(v, second_to_last)
} If you need to add an alias to the Module itself in addition to module members, you can do that in a single use using Self. Self is a member of sorts that refers to the module. 如果除了模块成员之外，您还需要为模块本身添加别名，您可以使用 Self 在一次use中完成。 Self 是指模块的各种成员。 use std::vector::{Self, empty};
For clarity, all of the following are equivalent: For clarity, all of the following are equivalent: 为清晰起见，以下所有内容都是等效的： use std::vector;
use std::vector as vector;
use std::vector::Self;
use std::vector::Self as vector;
use std::vector::{Self};
use std::vector::{Self as vector}; If needed, you can have as many aliases for any item as you like 如果需要，您可以为任何项目设置任意数量的别名 use std::vector::{ Self, Self as V, length, length as len,
}; fun pop_twice<T>(v: &mut vector<T>): (T, T) { // all options available given the `use` above assert!(vector::length(v) > 1, 42); assert!(V::length(v) > 1, 42); assert!(length(v) > 1, 42); assert!(len(v) > 1, 42); (vector::pop_back(v), vector::pop_back(v))
}

