A module can declare other modules as friends via friend declaration statements, in the format of 一个模块可以通过友元声明语句将其他模块声明为友元，格式为： friend <address::name> — friend declaration using fully qualified module name like the example below, or friend <address::name>— 使用完全合格的模块名称的友元声明，如下例所示，或 address 0x42 {
module a { friend 0x42::b;
}
} friend <module-name-alias> — friend declaration using a module name alias, where the module alias is introduced via the use statement. friend <module-name-alias>— 使用模块名称别名的友元声明，其中模块别名是通过use语句引入的。 address 0x42 {
module a { use 0x42::b; friend b;
}
} A module may have multiple friend declarations, and the union of all the friend modules forms the friend list. In the example below, both 0x42::B and 0x42::C are considered as friends of 0x42::A. 一个模块可能有多个友元声明，所有好友模块的并集形成友元列表。在下面的示例中，0x42::B和0x42::C都被视为 的友元函数0x42::A。 address 0x42 { module a { friend 0x42::b; friend 0x42::c; } } Unlike use statements, friend can only be declared in the module scope and not in the expression block scope. friend declarations may be located anywhere a top-level construct (e.g., use, function, struct, etc.) is allowed. However, for readability, it is advised to place friend declarations near the beginning of the module definition. 与use语句不同，friend只能在模块作用域内声明，而不能在表达式块的作用域内声明。friend声明可以位于允许顶层构造的任何位置（例如， use， function，struct等）是被允许的。但是，为了可读性，建议将友元声明放在模块定义的开头附近。 Note that the concept of friendship does not apply to Move scripts: A Move script cannot declare friend modules as doing so is considered meaningless: there is no mechanism to call the function defined in a script. A Move module cannot declare friend scripts as well because scripts are ephemeral code snippets that are never published to global storage. 请注意，友元关系（friendship）的概念不适用于 Move 脚本： Move 脚本不能声明friend模块，因为这样做被认为是无意义的：没有机制可以调用脚本中定义的函数。 Move 模块也不能声明friend脚本，因为脚本是永远不会发布到全局存储的临时代码片段。

