In Move, we can use generics to define functions and structs over different input data types. Generics are a great building block for library code. In this section, we are going to make our simple BasicCoin module generic so that it can serve as a library module that can be used by other user modules. 在 Move 语言中，我们可以使用泛型来定义不同输入数据类型的函数和结构体。泛型是库代码的重要组成部分。在本节中，我们将使我们的简单 BasicCoin 模块泛型化，以便它可以用作其他用户模块可以使用的模块库。 First, we add type parameters to our data structs: 首先，我们将类型参数添加到我们的数据结构中： struct Coin<phantom CoinType> has store { value: u64
} struct Balance<phantom CoinType> has key { coin: Coin<CoinType>
} We also add type parameters to our methods in the same manner. For example, withdraw becomes the following: 我们还以相同的方式将类型参数添加到我们的方法中。例如，withdraw 变成如下： fun withdraw<CoinType>(addr: address, amount: u64) : Coin<CoinType> acquires Balance { let balance = balance_of<CoinType>(addr); assert!(balance >= amount, EINSUFFICIENT_BALANCE); let balance_ref = &mut borrow_global_mut<Balance<CoinType>>(addr).coin.value; *balance_ref = balance - amount; Coin<CoinType> { value: amount }
} Take a look at step_6/BasicCoin/sources/BasicCoin.move to see the full implementation. 查看 step_6/BasicCoin/sources/BasicCoin.move 完整的实现。 At this point, readers who are familiar with Ethereum might notice that this module serves a similar purpose as the ERC20 token standard , which provides an interface for implementing fungible tokens in smart contracts. One key advantage of using generics is the ability to reuse code since the generic library module already provides a standard implementation and the instantiating module can provide customizations by wrapping the standard implementation. 此时，熟悉以太坊的读者可能会注意到，该模块的用途与 ERC20 token standard 类似，后者提供了在智能合约中实现可替代代币的接口。使用泛型的一个关键优势是能够重用代码，因为泛型模块库已经提供了标准实现，并且实例化模块可以通过包装标准实现提供定制化功能。 We provide a little module called MyOddCoin that instantiates the Coin type and customizes its transfer policy: only odd number of coins can be transferred. We also include two tests to test this behavior. You can use the commands you learned in step 2 and step 5 to run the tests. 我们提供了一个称为 MyOddCoin 并实例化 Coin 类型并自定义其转移策略的小模块：只能转移奇数个代币。其还包括两个 tests 来测试这种行为。您可以使用在第 2 步和第 5 步中学到的命令来运行测试。 进阶主题 (Advanced topics): phantom 类型参数 (phantom type parameters) In definitions of both Coin and Balance, we declare the type parameter CoinType to be phantom because CoinType is not used in the struct definition or is only used as a phantom type parameter. 在 Coin 和 Balance 的定义中，我们将类型参数 CoinType 声明为phantom，因为 CoinType 没有在结构体定义中使用或仅用作 phantom 类型参数。 Read more about phantom type parameters here. 阅读更多有关 phantom 类型参数 信息.

