References to global resources returned by borrow_global or borrow_global_mut mostly behave like references to local storage: they can be extended, read, and written using ordinary reference operators and passed as arguments to other function. However, there is one important difference between local and global references: a function cannot return a reference that points into global storage . For example, these two functions will each fail to compile: borrow_global 或 borrow_global_mut 指令返回的全局资源引用在大多数情况下类似本地存储的引用：它们可以通过 引用操作 进行拓展、读和写，也可以作为其它函数的参数。然而本地引用和全局引用有个重要差异： 函数不能返回指向全局存储的引用 。例如，下面两个函数编译会失败： struct R has key { f: u64 }
// 不能编译 // will not compile
fun ret_direct_resource_ref_bad(a: address): &R { borrow_global<R>(a) // error!
}
// 也不能编译 // also will not compile
fun ret_resource_field_ref_bad(a: address): &u64 { &borrow_global<R>(a).f // error!
} Move must enforce this restriction to guarantee absence of dangling references to global storage. This section contains much more detail for the interested reader. Move必须强制这种限制来保证全局存储引用不会出现空引用。对于感兴趣的读者， 此节 包含了更多的细节。

