Global storage operations can be applied to generic resources with both instantiated and uninstantiated generic type parameters: 全局存储操作可以与实例化和未实例化的泛型资源参数使用： struct Container<T> has key { t: T } /// 发布用于存储调用者提供 T 类型对象的 Container /// Publish a Container storing a type T of the caller's choosing
fun publish_generic_container<T>(account: &signer, t: T) { move_to<Container<T>>(account, Container { t })
} /// 发布存储 u64 类型的 Container /// Publish a container storing a u64
fun publish_instantiated_generic_container(account: &signer, t: u64) { move_to<Container<u64>>(account, Container { t })
} The ability to index into global storage via a type parameter chosen at runtime is a powerful Move feature known as storage polymorphism . For more on the design patterns enabled by this feature, see Move generics . 能够通过参数类型在运行时中索引全局存储的能力是 Move 的强大特性，该特性称之为 存储多态性 。关于此特性更多的设计模式，请参考 Move泛型 这节。

