The simple Counter module below exercises each of the five global storage operators. The API exposed by this module allows: Anyone to publish a Counter resource under their account Anyone to check if a Counter exists under any address Anyone to read or increment the value of a Counter resource under any address An account that stores a Counter resource to reset it to zero An account that stores a Counter resource to remove and delete it 下面简单的 Counter 模块使用五种全局存储操作。该模块暴露的API允许： 任何人可以在他们的账户下发布 Counter 资源。 任何人可以检查任何地址下是否包含 Counter。 任何人可以读或增加任何地址下的 Counter 值。 存储 Counter 资源的账号可以将其重置为 0。 存储 Counter 资源的账号可以删除该对象。 address 0x42 {
module counter { use std::signer; /// 包含整数的资源 /// Resource that wraps an integer counter struct Counter has key { i: u64 } /// 给定账户下发布带有 `i` 值的 `Counter` 资源 /// Publish a `Counter` resource with value `i` under the given `account` public fun publish(account: &signer, i: u64) { // “打包"（创建）Counter 资源。这是需要授权的操作，只能在声明 `Counter` 资源的此模块内执行。 // "Pack" (create) a Counter resource. This is a privileged operation that can only be done inside the module that declares the `Counter` resource move_to(account, Counter { i }) } /// 读取 `addr` 地址下 `Counter` 内的值 /// Read the value in the `Counter` resource stored at `addr` public fun get_count(addr: address): u64 acquires Counter { borrow_global<Counter>(addr).i } /// 增加 `addr` 地址下 `Counter` 内的值 /// Increment the value of `addr`'s `Counter` resource public fun increment(addr: address) acquires Counter { let c_ref = &mut borrow_global_mut<Counter>(addr).i; *c_ref = *c_ref + 1 } /// 将 `account` 的 `Counter` 重置为 0 /// Reset the value of `account`'s `Counter` to 0 public fun reset(account: &signer) acquires Counter { let c_ref = &mut borrow_global_mut<Counter>(signer::address_of(account)).i; *c_ref = 0 } /// 删除 `account` 的 `Counter` 资源并返回其内值 /// Delete the `Counter` resource under `account` and return its value public fun delete(account: &signer): u64 acquires Counter { // 删除 Counter 资源 // remove the Counter resource let c = move_from<Counter>(signer::address_of(account)); // 将 `Counter` 资源“拆”为字段。这是需要授权的操作，只能在声明 `Counter` 资源的此模块内执行。 // "Unpack" the `Counter` resource into its fields. This is a privileged operation that can only be done inside the module that declares the `Counter` resource let Counter { i } = c; i } /// 如果 `addr` 下包含 `Counter` 资源，则返回 `true`。 /// Return `true` if `addr` contains a `Counter` resource public fun exists(addr: address): bool { exists<Counter>(addr) }
}
}

