In the counter example, you might have noticed that the get_count, increment, reset, and delete functions are annotated with acquires Counter. A Move function m::f must be annotated with acquires T if and only if: The body of m::f contains a move_from<T>, borrow_global_mut<T>, or borrow_global<T> instruction, or The body of m::f invokes a function m::g declared in the same module that is annotated with acquires 在 counter 例子中，可以注意到 get_count、increment、reset 和 delete 方法都使用 acquires Counter 进行标注。函数 m::f 在且仅在下述情况必须使用 acquires T 进行标注： m::f 的主体包含 move_from<T>、borrow_global_mut<T> 或 borrow_global<T> 指令调用 m::f 的主体调用了同模块内被 acquires 注解的 m::g 的函数 For example, the following function inside Counter would need an acquires annotation: 例如，下面 Counter 内的函数需要使用 acquires 标注： // 由于 `increment` 使用了 `acquires` 标注，所以函数需要 `acquires` // Needs `acquires` because `increment` is annotated with `acquires`
fun call_increment(addr: address): u64 acquires Counter { counter::increment(addr)
} However, the same function outside Counter would not need an annotation: 然而，在 Counter 外面 的函数则不需要进行标注： address 0x43 {
module m { use 0x42::counter; // 可以，仅在函数声明在同一模块内时需要标注 // Ok. Only need annotation when resource acquired by callee is declared in the same module fun call_increment(addr: address): u64 { counter::increment(addr) }
}
} If a function touches multiple resources, it needs multiple acquires: 如果函数需要多个资源，acquires 则需要多个参数： address 0x42 {
module two_resources { struct R1 has key { f: u64 } struct R2 has key { g: u64 } fun double_acquires(a: address): u64 acquires R1, R2 { borrow_global<R1>(a).f + borrow_global<R2>.g }
}
} The acquires annotation does not take generic type parameters into account: acquires 标注不会将泛型类型参数纳入声明中： address 0x42 {
module m { struct R<T> has key { t: T } // 效果为 `acquires R` 而不是 `acquires R<T>` // `acquires R`, not `acquires R<T>` fun acquire_generic_resource<T: store>(a: addr) acquires R { let _ = borrow_global<R<T>>(a); } // 效果为 `acquires R` 而不是 `acquiresR<u64>` // `acquires R`, not `acquires R<u64> fun acquire_instantiated_generic_resource(a: addr) acquires R { let _ = borrow_global<R<u64>>(a); }
}
} Finally: redundant acquires are not allowed. Adding this function inside Counter will result in a compilation error: 最后：不允许使用不必要的 acquires。在 Counter 内添加下述方法将会导致编译错误： // 下面代码不会编译，因为函数体没有使用全局存储指令也没调用使用 `acquires` 注解的函数 // This code will not compile because the body of the function does not use a global storage instruction or invoke a function with `acquires`
fun redundant_acquires_bad() acquires Counter {} For more information on acquires, see Move functions . 关于 acquires 更多信息，参见 Move 函数 。

214.body:
Move prohibits returning global references and requires the acquires annotation to prevent dangling references. This allows Move to live up to its promise of static reference safety (i.e., no dangling references, no null or nil dereferences) for all reference types. Move 禁止返回全局引用并且需要使用 acquires 标注来防止空引用。这使 Move 保证了所有 引用 类型的静态引用安全性（例如，没有空引用、不会解引用 null 或 nil 对象）。 This example illustrates how the Move type system uses acquires to prevent a dangling reference: 这个例子展示了 Move 类型系统如何通过使用 acquires 来防止空引用： address 0x42 {
module dangling { struct T has key { f: u64 } fun borrow_then_remove_bad(a: address) acquires T { let t_ref: &mut T = borrow_global_mut<T>(a); let t = remove_t(a); // 类型系统不允许 t_ref 这种空引用 // type system complains here // t_ref now dangling! let uh_oh = *&t_ref.f } fun remove_t(a: address): T acquires T { move_from<T>(a) } }
} In this code, line 6 acquires a reference to the T stored at address a in global storage. The callee remove_t then removes the value, which makes t_ref a dangling reference. 代码中第六行获取了 a 地址在全局存储中 T 类型资源的引用。remove_t 调用删除了该值，使 t_ref 变成空引用。 Fortunately, this cannot happen because the type system will reject this program. The acquires annotation on remove_t lets the type system know that line 7 is dangerous, without having to recheck or introspect the body of remove_t separately! 幸运的是，由于类型系统拒绝编译程序导致这种情况不会发生。remove_t 方法的 acquires 标注让类型系统知道第七行是危险的，不需要再分析 remove_t 的函数体。 The restriction on returning global references prevents a similar, but even more insidious problem: 禁止返回全局引用的限制同时也防止了类似却更隐晦的问题： address 0x42 {
module m1 { struct T has key {} public fun ret_t_ref(a: address): &T acquires T { borrow_global<T>(a) // 报错 类型系统在这不能继续编译 // error! type system complains here } public fun remove_t(a: address) acquires T { let T {} = move_from<T>(a); }
} module m2 { fun borrow_then_remove_bad(a: address) { let t_ref = m1::ret_t_ref(a); let t = m1::remove_t(a); // t_ref 为空引用 // t_ref now dangling! }
}
} Line 16 acquires a reference to a global resource m1::T, then line 17 removes that same resource, which makes t_ref dangle. In this case, acquires annotations do not help us because the borrow_then_remove_bad function is outside of the m1 module that declares T (recall that acquires annotations can only be used for resources declared in the current module). Instead, the type system avoids this problem by preventing the return of a global reference at line 6. 第十六行获取了全局资源 m1::T 类型的引用，然后第十七行删除了同一资源，这使 t_ref 变成空引用。在这个例子中，acquires 标注没有帮助到我们，因为 borrow_then_remove_bad 函数在声明了 T 类型（回顾 acquires 标注只用在声明此类型的模块内）的 m1 模块外。然而禁止返回全局引用的规则使第六行避免了这个问题。 Fancier type systems that would allow returning global references without sacrificing reference safety are possible, and we may consider them in future iterations of Move. We chose the current design because it strikes a good balance between expressivity, annotation burden, and type system complexity. 允许返回全局引用而尽可能不牺牲引用安全的高级类型系统是可行的，我们将会在 Move 未来的迭代过程中考虑此事。我们选择目前的设计方式是因为它很好的平衡了语言表现力、复杂的标注和复杂的类型系统三者的关系。

