Smart contracts deployed on the blockchain may manipulate high-value assets. As a technique that uses strict mathematical methods to describe behavior and reason correctness of computer systems, formal verification has been used in blockchains to prevent bugs in smart contracts. The Move prover is an evolving formal verification tool for smart contracts written in the Move language. The user can specify functional properties of smart contracts using the Move Specification Language (MSL) and then use the prover to automatically check them statically. To illustrate how the prover is used, we have added the following code snippet to the BasicCoin.move : 部署在区块链上的智能合约可能会操纵高价值资产。作为一种使用严格的数学方式来描述计算机系统的行为和推理正确性的技术，形式化验证已被用于区块链，以防止智能合约中错误的产生。 Move验证器 是一种在进化中、用Move 语言编写的智能合约形式化验证工具。用户可以使用 Move语言规范(Move Specification Language (MSL)) 指定智能合约的功能属性，然后使用验证器自动静态检查它们。 为了说明如何使用验证器，我们在 BasicCoin.move 中添加了以下代码片段： spec balance_of { pragma aborts_if_is_strict; } Informally speaking, the block spec balance_of {...} contains the property specification of the method balance_of. 通俗地说，代码块 spec balance_of {...} 包含 balance_of 方法的属性规范说明。 Let's first run the prover using the following command inside BasicCoin directory : 首先在 BasicCoin directory 目录中使用以下命令运行验证器。 move prove which outputs the following error information: 它输出以下错误信息： error: abort not covered by any of the `aborts_if` clauses ┌─ ./sources/BasicCoin.move:38:5 │
35 │ borrow_global<Balance<CoinType>>(owner).coin.value │ ------------- 由于执行失败这里发生中止 ·
38 │ ╭ spec balance_of {
39 │ │ pragma aborts_if_is_strict;
40 │ │ } │ ╰─────^ │ = at ./sources/BasicCoin.move:34: balance_of = owner = 0x29 = at ./sources/BasicCoin.move:35: balance_of = 中止 Error: exiting with verification errors The prover basically tells us that we need to explicitly specify the condition under which the function balance_of will abort, which is caused by calling the function borrow_global when owner does not own the resource Balance<CoinType>. To remove this error information, we add an aborts_if condition as follows: 验证器大体上告诉我们，我们需要明确指定函数 balance_of 中止的条件，中止原因是 owner(函数调用者)在没有资源 Balance<CoinType> 的情况下调用 borrow_global 函数导致的。要去掉此错误信息，我们添加如下 aborts_if 条件： spec balance_of { pragma aborts_if_is_strict; aborts_if !exists<Balance<CoinType>>(owner); } After adding this condition, try running the prove command again to confirm that there are no verification errors: 添加此条件后，再次尝试运行prove命令，确认没有验证错误： move prove Apart from the abort condition, we also want to define the functional properties. In Step 8, we will give more detailed introduction to the prover by specifying properties for the methods defined the BasicCoin module. 除了中止条件，我们还想定义功能属性。在第 8 步中，我们将通过为定义 BasicCoin 模块的方法指定属性来更详细地介绍验证器。

