} 但是删除包含带有 drop 能力的元素的向量不会发生错误： fun destroy_droppable_vector<T: drop>(vec: vector<T>) { // 有效！ // 不需要明确地做任何事情来销毁向量
} Similarly, vectors cannot be copied unless the element type has copy. In other words, a vector<T> has copy if and only if T has copy. However, even copyable vectors are never implicitly copied: 同样，除非元素类型具有 copy 能力，否则无法复制向量。换句话说，当且仅当 T 具有 copy 能力时，vector<T> 才具有 copy 能力。然而，即使是可复制的向量也永远不会被隐式复制： 换句话说，vector<T> 有 copy 能力当且仅当 T 有 copy 能力。然而，即使是可复制的向量也永远不会被隐式复制： let x = vector::singleton<u64>(10);
